import ReactDOM from 'react-dom';
import './index.css';

const ResultList = () => {
    return(
        <ul>
            <li>ksdf</li>
            <li>ksddf</li>
            <li>ksddf</li>
        </ul>
    )
}

const UsernameInput = () => {
    return(
        <input placeholder='dale'/>
    )
}

/////////

const Main = () => {
       return(
            <div>
                <UsernameInput />
                <ResultList />
            </div>
       ) 

}

